(1, 'Pet Adoption Fair', '2024-06-18 00:00:00', 'pet-adoption-fair', 12, 'Partner with local animal shelters and rescue organizations to host an adoption fair where people can meet and adopt adorable pets in need of loving homes.', '1 Fantastic Street,\nNear Croma Building,\nToronto, ON M5V 2W6,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:09', '2024-06-12 05:56:09', NULL),
(2, 'Pet Health Check-Up Day', '2024-06-14 00:00:00', 'pet-health-check-up-day', 18, 'Offer a day of free or discounted pet health check-ups, where pet owners can bring their furry companions for a general health assessment, vaccinations, and preventive care advice.', '22 Maple Avenue,\nNext to Skyline Tower,\nVancouver, BC V6Z 1Z1,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:09', '2024-06-12 05:56:09', NULL),
(3, 'Pet Grooming for Charity', '2024-06-20 00:00:00', 'pet-grooming-for-charity', 25, 'Dedicate a portion of your proceeds from a specific day or week to support a local animal shelter or pet-related charity.', '123 Lakeview Drive,\nAcross from City Center,\nCalgary, AB T2P 0L5,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:09', '2024-06-12 05:56:09', NULL),
(4, 'Pet Costume Contest', '2024-07-02 00:00:00', 'pet-costume-contest', 13, 'Hold a fun and creative pet costume contest, encouraging participants to dress up their furry friends in various themes and win exciting prizes.', '45 Riverside Road,\nAdjacent to Tech Park,\nKelowna, BC V1Y 3P2,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:09', '2024-06-12 05:56:09', NULL),
(5, 'Pet Talent Show', '2024-06-29 00:00:00', 'pet-talent-show', 33, 'Let pets showcase their unique talents and tricks. From dogs performing tricks to cats doing agility, this event will surely entertain the audience.', '678 Pine Street,\nNear Harbor Mall,\nMontreal, QC H3A 1A7,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:09', '2024-06-12 05:56:09', NULL),
(6, 'Pet Grooming Photo Contest', '2024-06-17 00:00:00', 'pet-grooming-photo-contest', 30, 'Encourage pet owners to share photos of their freshly groomed pets on social media, and award prizes for the most stylish and adorable transformations.', '789 Mountain View Lane,\nBeside Business Plaza,\nEdmonton, AB T5J 3H1,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:09', '2024-06-12 05:56:09', NULL),
(7, 'Dog Agility Competition', '2024-07-09 00:00:00', 'dog-agility-competition', 41, 'Set up an agility course with obstacles for dogs to showcase their speed and skills. This event can be a great way to entertain both participants and spectators.', '56 Forest Avenue,\nBy Civic Center,\nWinnipeg, MB R3L 0L9,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:09', '2024-06-12 05:56:09', NULL),
(8, 'Pet Birthday Paw-ty', '2024-07-06 00:00:00', 'pet-birthday-paw-ty', 45, 'Celebrate the birthdays of pets at the day care with pet-friendly birthday cakes, party hats, and goodie bags for the furry guests.', '999 Oceanfront Drive,\nNear Innovation Park,\nHalifax, NS B3H 4R2,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:10', '2024-06-12 05:56:10', NULL),
(9, 'Vaccination Drive', '2024-06-23 00:00:00', 'vaccination-drive', 23, 'Organize a vaccination drive to ensure pets in the community are up-to-date on their vaccinations to prevent the spread of infectious diseases.', '333 Sunset Boulevard,\nJust off Downtown Square,\nRegina, SK S4P 3V2,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:10', '2024-06-12 05:56:10', NULL),
(10, 'Fear-Free Training Seminar', '2024-06-28 00:00:00', 'fear-free-training-seminar', 36, 'Host a seminar on fear-free training techniques, emphasizing positive reinforcement methods to build trust and confidence in pets.', '777 Riverwalk Place,\nOpposite Civic Auditorium,\nQuebec City, QC G1R 2L1,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:10', '2024-06-12 05:56:10', NULL),
(11, 'Puppy/Kitten Socialization & Grooming Party', '2024-07-01 00:00:00', 'puppy-kitten-socialization-&-grooming-party', 26, 'Organize a socialization and grooming event specifically for young pets, helping them become more comfortable with grooming at an early age.', '21 Serene Street,\nNear Tech Hub,\nVictoria, BC V8W 2B7,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:10', '2024-06-12 05:56:10', NULL),
(12, 'Pet Olympics', '2024-06-19 00:00:00', 'pet-olympics', 39, 'Organize a fun event with various pet-friendly games and activities to entertain pets and their owners.', '555 Harborview Road,\nClose to Shopping Center,\nSt. John\'s, NL A1A 1A1,\nCanada', 1, NULL, NULL, NULL, '2024-06-12 05:56:10', '2024-06-12 05:56:10', NULL);
