(1, 'Sojoss Simply Beef Freeze-Dried Dog Treats, 4-oz bag', 'sojoss-simply-beef-freeze-dried-dog-treats-4-oz-bag-tgtvr', 'Bite Sized Treat, Big sized Flavor: Simply Beef is 100% raw', '<p>Bite Sized Treat, Big sized Flavor: Simply Beef is 100% raw, freeze dried meat is the healthy and flavorful way to train your pup, or simply reward him for being the best dog ever; it’s the perfect treat for every occasion.</p>', NULL, 1, NULL, 20, 20, 0, 'percent', 1695168000, 1695168000, NULL, 22, 1, 1, 0, 0, 1, 1, 8, 0, 0, NULL, 0, 1, NULL, 1, '2023-09-20 06:48:47', '2024-06-12 05:57:14', NULL),
(2, 'Droools Adult Wet Dog Food, Real Chicken And Chicken Liver Chunks In Gravy', 'droools-adult-wet-dog-food-real-chicken-and-chicken-liver-chunks-in-gravy-5w3ot', NULL, '<p> A nutritious food that supports your pet\'s joint health.</p><p>Complete Meat, Serve Solo or Mix with Dry Kibble and feed.</p><p>Perfect meal which supports Dogs brain &amp; eye development.</p><p>Real Chicken, Liver and Eggs Keeps your pet active and agile all day.</p><p>Loaf in gravy, which provides all the nutrients required for a healthy life.</p>', NULL, 1, NULL, 30, 50, 0, 'percent', 1695168000, 1695168000, NULL, 14, 1, 1, 0, 0, 1, 1, 0, 0, 0, NULL, 0, 1, NULL, 1, '2023-09-20 06:56:30', '2023-09-20 07:24:07', NULL),
(3, 'Loveeabowl Grain Free Chicken & Snow Crab Cat Dry Food', 'loveeabowl-grain-free-chicken-snow-crab-cat-dry-food-dxesw', NULL, '<p> Promotes healthy bones and ideal for cats with allergies</p>', NULL, 2, NULL, 40, 55, 0, 'percent', 1695168000, 1695168000, NULL, 11, 1, 1, 0, 0, 1, 1, 0, 0, 0, NULL, 0, 1, NULL, 1, '2023-09-20 07:05:17', '2023-09-20 07:23:05', NULL),
(4, 'HUFFT Cat Mahi Mahi Fish Crunchies', 'hufft-cat-mahi-mahi-fish-crunchies-mctht', NULL, '<p> Dehydrated, slow-cooked, gluten-free cat treats</p>', NULL, 1, NULL, 10, 25, 0, 'percent', NULL, NULL, 0, 20, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:18:03', '2023-09-20 07:18:03', NULL),
(5, 'Pureepet Mackerel Adult Cat Dry Food', 'pureepet-mackerel-adult-cat-dry-food-u8qbt', NULL, '<p> Purepet Mackerel Adult Cat food is formulated with essential ingredients to provide overall wellness to your Cat. Enriched with Mackerel and other essential ingredients helps your feline to maintain a beautiful skin and coat. Taurine, an essential amino acid that keeps heart healthy and promotes growth and development. It is highly palatable and easy to digest.</p>', NULL, 1, NULL, 99, 199, 0, 'percent', NULL, NULL, 0, 22, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:21:46', '2023-09-20 07:21:49', NULL),
(6, 'Feekoo Pet Heating Pad,Large Electric Heating Pad for Dogs and Cats Indoor Adjustable Warming Mat', 'feekoo-pet-heating-padlarge-electric-heating-pad-for-dogs-and-cats-indoor-adjustable-warming-mat-k5rfp', NULL, '<p>Heating Pad with Timer and Auto Power Off: BurgeonNest heating pad for dog has 5 timer option - Always(default setting),4H, 8H, 12H, 24H and adjustable comfortable temperature setting( 86-131/30-55). Equipped with upgrade thermostats, such pet heating pad can precisely control temperature and will be powered off after arrives the setting time</p>', NULL, NULL, NULL, 56, 56, 0, 'percent', NULL, NULL, 0, 25, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:31:03', '2023-09-20 07:31:03', NULL),
(7, 'BirdiesNature All Natural Enriching Treats for Large Birds (Ranch Mix)', 'birdiesnature-all-natural-enriching-treats-for-large-birds-ranch-mix-zrkxi', NULL, '<p>BirdsNature understands that sharing your life with a small pet is not only enjoyable but very enriching. BirdsNature shows our love by ensuring we provide your small pet with the best nutrition for a long and healthy life. it’s no wonder why BirdsNature is at the heart of every healthy feeding routine. </p>', NULL, 1, NULL, 29, 59, 0, 'percent', NULL, NULL, 0, 22, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:35:28', '2023-09-20 22:38:14', NULL),
(8, 'Vitaakraft Yogurt Drops - Rabbit - 5.3 Ounce', 'vitaakraft-yogurt-drops-rabbit-53-ounce-8r2uu', NULL, '<p><span style=\"color: rgb(21, 21, 21);\">VitaKraft\'s Rabbit Yogurt drops are a popular treat containing yogurt, natural whey protein and no artificial colorings. Our yogurt drops are a treat your pet is sure to love. Use our treat as a between meal snack or any time your pet deserves a special reward. Features essential lecithin your pet needs to stay healthy. Resealable bag keeps treats fresh and tasty. Drops are made with yogurt and are a tasty treat your rabbit will love.</span></p>', NULL, 1, NULL, 45, 90, 0, 'percent', NULL, NULL, 0, 18, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:38:04', '2023-09-20 22:38:12', NULL),
(9, 'Pet Heeating Lamp Holder UVB/UVA Bulb Aquarium Lighting Infrared Ceramic Heat Emitter Light Bulb Holder for Reptile Pet Brooder Y200922', 'pet-heeating-lamp-holder-uvbuva-bulb-aquarium-lighting-infrared-ceramic-heat-emitter-light-bulb-holder-for-reptile-pet-brooder-y200922-9hx9r', NULL, '<p>Lamp base: E27</p><p>Voltage: 110-220V</p><p>Length for the electric wire: 150CM</p><p>Maximum load power: Below 200W(Not included 200W)</p><p>Net Weight: 280g</p><p>This item can be rotated 360 degrees in up / down / left / right direction</p><p>Fit E27 light, this is a holder for a screw in light. </p>', NULL, NULL, NULL, 100, 100, 0, 'percent', NULL, NULL, 0, 30, 1, 1, 1, 1, 0, 1, 0, 72, 24, NULL, 0, 1, NULL, 1, '2023-09-20 07:42:56', '2023-09-20 07:42:56', NULL),
(10, 'Nylonn Pet Dog Collars Adjustable Dogs Tactics Training Collar Outdoor Medium Large Army Dog Collar Durable Pets Supplies', 'nylonn-pet-dog-collars-adjustable-dogs-tactics-training-collar-outdoor-medium-large-army-dog-collar-durable-pets-supplies-hwkwu', NULL, '<p>Durable Dog Collar Military tactical dog collars is made of 1680D high-quality nylon material.tactical collar set with a soft padded lining to prevent chafing for your dog\'s skin and hair, which is very durable, wear-resisting, highly recommended by military and police equipment fans.</p>', NULL, NULL, NULL, 70, 70, 0, 'percent', 1695254400, 1695254400, NULL, 45, 1, 1, 0, 0, 1, 1, 0, 0, 0, NULL, 0, 1, NULL, 1, '2023-09-20 22:42:32', '2023-09-20 22:46:53', NULL),
