(60, 'Peetoology Professional Automatic Rechargeable Pet Hair Trimmer for Dogs & Cats Grooming Machine Wireless (Grey Trimmer)', 'peetoology-professional-automatic-rechargeable-pet-hair-trimmer-for-dogs-cats-grooming-machine-wireless-grey-trimmer-gwgci', NULL, '<p>-Sharp &amp; Durable: High quality titanium blade with ceramic comb</p><p>-Rechargeable &amp; Cordless: Charge for 5 hours and use for 60-70 minutes</p><p>-User Friendly: 3-6-9-12 mm adjusting and detachable guide combs</p><p>-Low Noise: The precision motor generates low sound &amp; vibration</p><p>-5 degree fine-tuning functions from 0.8 mm to 2 mm for a professional cut</p>', NULL, NULL, NULL, 20, 20, 0, 'percent', NULL, NULL, 0, 55, 1, 1, 1, 1, 0, 1, 0, 72, 24, NULL, 0, 60, NULL, 60, '2023-09-22 01:23:22', '2023-09-22 01:23:22', NULL),
(61, 'Store Grinder Nail Clipper  (For Dog, Cat, Rabbit, Hamster)', 'store-grinder-nail-clipper-for-dog-cat-rabbit-hamster-zuzgm', NULL, '<p>Precise clipping: Strong stainless steel and sharp edge can easily trim thick nails of small, medium and large dogs to avoid chipping. After clipping, use the included nail file to polish your dog\'s toenails so that they are rounded and less likely to scratch.Ergonomic design: The wavy handle of the dog nail trimmers is designed to fit the human hand shape. The upgraded silicone material is non-slip and does not rub your hands. It is the first recommendation of many pet doctors, professional pet groomers, animal trainers and thousands of satisfied customers.Safety guard: The nails of small cats and puppy are short and sharp. </p>', NULL, NULL, NULL, 59, 59, 0, 'percent', NULL, NULL, 0, 59, 1, 1, 1, 1, 0, 1, 1, 72, 24, NULL, 0, 61, NULL, 61, '2023-09-22 01:26:35', '2024-06-12 05:57:14', NULL),
(62, 'Caature Purelab Natural Ear Cleanser for Dog/Cat 120 ml', 'caature-purelab-natural-ear-cleanser-for-dogcat-120-ml-huh0q', NULL, '<p>-Removes dirt and ear wax- Did you know that your dog’s ears help maintain normal body temperature by radiating excess body heat? Cleaning and maintaining your dog’s ears removes dirt, yeast, and ear wax buildup and acts as an odor eliminator. This dog ear infection treatment is professional strength to deodorize, flush dirt and clean effectively while being gentle on your pet.</p><p>-Non-irritating - Are you worried that the harsh chemicals found in some pet ear cleansers can be irritating to your pet’s ears and harmful to the environment? Our dog ear wash formula is derived from coconut and palm which are naturally antiseptic, antifungal, antibacterial, and antimicrobial, clean gently and are more eco-friendly</p><p>-Use-Place a few drop into the ear and massage to dissolve and extract ear wax. Wipe with cotton balls</p><p>Keep out of the reach of children.</p>', NULL, NULL, NULL, 87, 87, 0, 'percent', NULL, NULL, 0, 54, 1, 1, 1, 1, 0, 1, 1, 72, 24, NULL, 0, 61, NULL, 61, '2023-09-22 01:32:23', '2024-06-12 05:57:14', NULL),
(63, 'Naatural Eye Cleanser for Dog/Cat 120 ml', 'naatural-eye-cleanser-for-dogcat-120-ml-tllea', NULL, '<p>Cature PureLab Eye Cleanser uses All natural ingredients to helps soften &amp; removes dried secretions. It cleans pet eyes and eyelids, removing foreign bodies (plant debris, dust, sand, etc) It also soothes &amp; nourishes the eyes and skin around the eye area without irritate the eyes. It is suitable for dogs and cats of any age.</p><p>Directions:</p><p>-Shake well before use. Turn the white nozzle to open the product and then apply liberally into the ear canal. Ensure that the ear column is completely filled.</p><p>-Gently rub the base of the ear and then wipe the interior of the ear flap with cotton or a cloth moistened with Epiotic® Ear Cleaner.</p><p>-Use 2-3 times a week for routine cleansing or as directed by a veterinarian.</p><p>-For pre-treatment in case of otitis externa, EPIOTIC ear cleanser may be used before each application of any other topical therapy, or as directed by your veterinarian.</p>', NULL, NULL, NULL, 58, 58, 0, 'percent', NULL, NULL, 0, 50, 1, 1, 1, 1, 0, 1, 0, 72, 24, NULL, 0, 61, NULL, 61, '2023-09-22 01:35:05', '2023-09-22 01:35:05', NULL),
(64, 'VetSaafe Pet perfume - 200ML', 'vetsaafe-pet-perfume-200ml-ufkoq', NULL, '<p>VetSafe Pet perfume - 200ML</p><p>-There may be days when your poochless may smell bad no matter how much pay attention to its hygiene.</p><p>-VetSafe pawfume is soul awakening deodoriser perfume made from natural plant extracts that makes your pet smell fresh instantly.</p><p>-Use after bath or in between bath or on special occasion or regularly. Safe for dogs, cats, horses and small pocket pets.</p><p>-For animal use only. Not to be ingested and only for topical application.</p>', NULL, 4, NULL, 82, 82, 0, 'percent', NULL, NULL, 0, 34, 1, 1, 1, 1, 0, 1, 1, 72, 24, NULL, 0, 18, NULL, 18, '2023-09-22 01:38:21', '2024-06-12 05:57:14', NULL),
(65, 'Vvjoy Pet Perfume Spray For All Pets - Controls Odor,Daily Use, Lavender Fragrance Deodorizer  (100 ml, Pack of 1)', 'vvjoy-pet-perfume-spray-for-all-pets-controls-odordaily-use-lavender-fragrance-deodorizer-100-ml-pack-of-1-zkmoo', NULL, '<p>Fragrance - Pet Perfume Spray For All Pets - Controls Odor,Daily Use, Lavender Fragrance</p><p>Type - Spray</p><p>Container Type - 100ml Spray Bottle</p><p>Storage Instructions - keep away from eyes and childrens</p><p>Net Quantity - 100 ml </p>', NULL, 4, NULL, 42, 42, 0, 'percent', NULL, NULL, 0, 64, 1, 1, 1, 1, 0, 1, 1, 72, 24, NULL, 0, 18, NULL, 18, '2023-09-22 01:40:57', '2024-06-12 05:57:14', NULL),
(66, 'Hair Removing Lint Roller with Cover Pet', 'hair-removing-lint-roller-with-cover-pet-ol8tc', NULL, '<p>-Colour: White &amp; Pink</p><p>-Material: Paper, HMPSA, polypropylene</p><p>-Lint roller handle: L*H: 10*18cm</p><p>-Roller refill: Roll inner diameter: 38mm(1.50in)</p><p>-Each sheet length: 10cm(3.94in)</p>', NULL, NULL, NULL, 63, 63, 0, 'percent', NULL, NULL, 0, 66, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 18, NULL, 18, '2023-09-22 01:43:24', '2023-09-22 01:43:24', NULL),
(67, 'Store Stainless Metal Flea Comb for Pets Grooming Comfortable to Use Dogs, Cats, Rabbit Flea and Tick Prevention for Animals, Flea Treatment Flea Prevention', 'store-stainless-metal-flea-comb-for-pets-grooming-comfortable-to-use-dogs-cats-rabbit-flea-and-tick-prevention-for-animals-flea-treatment-flea-prevention-mg9vs', NULL, '<p>-PARSITE REMOVAL WITHOUT INJURY-This premium quality flea comb is used to pull fleas or parasites out of the fur of your pets without causing any injury to the skin of your pet.Best in preventing hair from knotting and tangling in pets</p><p>-TRUST AND AFFECTION FOOSTERED-Foster affection and increase intimacy between you and your pet. makes you loved like never before.Shiny and beautiful hair is assured when this comb is used on your pet.</p><p>-HEALTH BENEFIT-This premium quality flea comb is designed to promote blood circulation in pets making them live longer.Also designed to remove dirt from the fur of your lovely pet and keeping them clean always.</p><p>-MASSAGE TOOL-Designed to gently massage your pet helping them feel comfortable and loved.Well designed handle for firm grip and proper hand positioning.</p>', NULL, NULL, NULL, 98, 98, 0, 'percent', NULL, NULL, 0, 70, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 18, NULL, 18, '2023-09-22 01:48:47', '2023-09-22 01:48:47', NULL),
(68, 'Royallle Cat Tweezers Mite Anti Dog Cat Pet Ticks and Fleas Flea Tick Clip Remover Mite Out - Color May Vary (Single Pack)', 'royallle-cat-tweezers-mite-anti-dog-cat-pet-ticks-and-fleas-flea-tick-clip-remover-mite-out-color-may-vary-single-pack-dchby', NULL, '<p>-100% brand new and high quality</p><p>-It\'s common that a few fleas and mites attach to pets. How did you get them rid of your pets?</p><p>-This product can do you a favor to eliminate the fleas and mites.</p><p>-You can eliminate disgusting mites by this professional tweezers, it\'s easy to use and safe.</p><p>-Press the button on the top of the tick remover to open the gripper to catch feet of fleas.</p>', NULL, NULL, NULL, 87, 87, 0, 'percent', NULL, NULL, 0, 66, 1, 1, 1, 1, 1, 1, 0, 72, 24, NULL, 0, 59, NULL, 59, '2023-09-22 01:52:08', '2023-09-22 01:52:08', NULL);
