(2, '247-supervision', '24/7 Supervision', 'Round-the-clock monitoring to ensure the safety and well-being of all pets.', 1, NULL, NULL, NULL, '2024-06-12 05:56:00', '2024-06-12 05:56:00', NULL),
(3, 'special-care-for-seniors-and-special-needs-pets', 'Special Care for Seniors and Special Needs Pets', 'Catering to the specific requirements of older pets or those with medical conditions.', 1, NULL, NULL, NULL, '2024-06-12 05:56:00', '2024-06-12 05:56:00', NULL),
(4, 'play-areas', 'Play Areas', 'Designated areas or play yards where pets can exercise and interact with other compatible animals.', 1, NULL, NULL, NULL, '2024-06-12 05:56:00', '2024-06-12 05:56:00', NULL),
(5, 'private-suites', 'Private Suites', 'Offer private, comfortable rooms or suites for pets who prefer more solitude and a quiet environment.', 1, NULL, NULL, NULL, '2024-06-12 05:56:00', '2024-06-12 05:56:00', NULL),
(6, 'pet-photography', 'Pet Photography', 'Offer pet photography sessions and send pictures to owners as a delightful keepsake.', 1, NULL, NULL, NULL, '2024-06-12 05:56:00', '2024-06-12 05:56:00', NULL),
